/* @jsx mdx */
  import React from 'react'
  import { mdx } from '@mdx-js/react'
  /* @jsx mdx */


const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">
    <h1 {...{
      "id": "libraries"
    }}>{`Libraries`}</h1>
    <blockquote>
      <p parentName="blockquote">{`Node modules are important and necessary to React.js applications; they contain all of the libraries
that helped us write this project with ease. Most of these modules are included when initially, but here are some of the libraries
we added to make this project successful! `}<br /></p>
    </blockquote>
    <p>{`Raspberry Pi utilizing Python 3.0:`}</p>
    <ul>
  <li>Reactjs</li>
  <li></li>
  <li>Milk</li>
    <li>Coffee</li>
  <li>Tea</li>
  <li>Milk</li>
    <li>Coffee</li>
  <li>Tea</li>
  <li>Milk</li>
    </ul>
    <p>{`Raspberry Pi:`}</p>
    </MDXLayout>;
}

MDXContent.isMDXComponent = true;
